#DiorMumbai Fall 23
mūḷ māthī / from the roots!
It’s indeed a very proud moment for India and my city Mumbai to celebrate a historic moment with the European luxury megabrand Christian Dior!

@dior Pre-Fall 2023 show by @mariagraziachiuri took place in Mumbai at Gateway of India. The show highlighted the incredible craftsmanship of Indian artists and craftsmen and most notably the impressive work of embroidery of the @chanakya.school The collection was one of the best from the European luxury megabrand. It was a perfect blend of traditional and modern, with fusion outfits accessorised with stunning pearl jewellery. The outfits celebrated and paid homage to Indian savoir-faire!

I feel extremely proud to say that India, has always been known for its intricate embroidery art, opulent textiles and embellishments! The history of India is marked by many centuries and Indian arts crafts and design have been appreciated globally! 🇮🇳🇮🇳

